import {BrowserRouter, Route, Routes } from 'react-router-dom'
import Home from './Home'
import Header from './Header';

function App() {
  return (
    <BrowserRouter>      
      <Header/>


      <Routes>
        <Route path='' exact element={Home}/>


      </Routes>
    </BrowserRouter>
  );
}

export default App;
